/*Table structure for table `agent_applications` */

DROP TABLE IF EXISTS `agent_applications`;

CREATE TABLE `agent_applications` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `a_id` int(11) NOT NULL COMMENT '代理商ID',
  `type` int(11) NOT NULL COMMENT '申请类型:0默认无效1注册2升级3变更4公司录入',
  `create_ctime` datetime NOT NULL COMMENT '申请时间',
  `target` int(11) NOT NULL COMMENT '申请目标:是否通过/目标等级/变更目标编号',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '审核状态:0待审核1已通过2已驳回3已取消',
  `examine_etime` datetime NOT NULL COMMENT '审核时间',
  `examiner` varchar(255) NOT NULL COMMENT '审核人',
  `remarks` varchar(255) NOT NULL COMMENT '备注信息',
