/*Table structure for table `agent_financial_account` */

DROP TABLE IF EXISTS `agent_financial_account`;

CREATE TABLE `agent_financial_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `a_id` int(11) NOT NULL COMMENT '代理商ID',
  `create_ctime` datetime NOT NULL COMMENT '注册时间',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '账户类型:0默认未知1支付宝2银行卡',
  `account` varchar(255) NOT NULL COMMENT '账号',
  `is_del` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否删除:0否1是',
  `is_default` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否默认账户:0否1是',
  `bank` varchar(255) DEFAULT NULL COMMENT '开户行',
  `name` varchar(255) DEFAULT NULL COMMENT '姓名',
  PRIMARY KEY (`id`)
