/*Table structure for table `agent_level` */

DROP TABLE IF EXISTS `agent_level`;

CREATE TABLE `agent_level` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '名称',
  `show` tinyint(4) NOT NULL COMMENT '是否显示',
  `valid` varchar(255) NOT NULL COMMENT '是否可用',
  `deep` int(11) NOT NULL DEFAULT '2' COMMENT '推荐奖励深度',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

/*Data for the table `agent_level` */

insert  into `agent_level`(`id`,`name`,`show`,`valid`,`deep`) values (1,'见习顾问',1,'1',2),(2,'高级顾问',1,'1',2),(3,'精英顾问',1,'1',2),(4,'资深顾问',1,'1',2),(5,'皇冠',2,'1',3),(6,'分公司',2,'1',3);

/*Table structure for table `agent_lower_stock_log` */

DROP TABLE IF EXISTS `agent_lower_stock_log`;

CREATE TABLE `agent_lower_stock_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `agent_id` int(11) NOT NULL COMMENT 'agent_id',
  `role` int(11) NOT NULL COMMENT 'role',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态1未降级2已降级3降级失败',
  `down_time` int(11) NOT NULL COMMENT '降级时间',
  `change_id` int(11) NOT NULL COMMENT '降级信息关联ID',
  `remark` varchar(255) NOT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

/*Data for the table `agent_lower_stock_log` */

/*Table structure for table `agent_order_change_price` */

DROP TABLE IF EXISTS `agent_order_change_price`;

CREATE TABLE `agent_order_change_price` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `operator` varchar(255) NOT NULL COMMENT '操作人',
  `new_order_number` varchar(255) NOT NULL COMMENT '新订单号',
  `new_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单现在价格',
  `original_order_number` varchar(255) NOT NULL COMMENT '原订单编号',
  `original_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单原始价格',
  `agent_order_ids` varchar(255) NOT NULL COMMENT '原订单表编号串唯一标识',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8;

