/*Table structure for table `agent_order_consignee_address` */

DROP TABLE IF EXISTS `agent_order_consignee_address`;

CREATE TABLE `agent_order_consignee_address` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(255) NOT NULL COMMENT '订单编号',
  `agent_id` int(11) NOT NULL COMMENT '代理商ID',
  `create_time` int(11) NOT NULL DEFAULT '1' COMMENT '创建时间',
  `consignee_name` varchar(255) NOT NULL COMMENT '收货人姓名',
  `consignee_phone` varchar(255) NOT NULL COMMENT '收货人电话',
  `province` varchar(255) NOT NULL COMMENT '省份',
  `city` varchar(255) NOT NULL COMMENT '城市',
  `area` varchar(255) NOT NULL COMMENT '地区',
  `address` varchar(255) NOT NULL COMMENT '收货人详细地址',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_number` (`order_number`)
) ENGINE=InnoDB AUTO_INCREMENT=962 DEFAULT CHARSET=utf8;

