/*Table structure for table `agent_order_refund` */

DROP TABLE IF EXISTS `agent_order_refund`;

CREATE TABLE `agent_order_refund` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(255) NOT NULL COMMENT '商户订单号',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `order_amount_pay` decimal(10,2) NOT NULL COMMENT '订单总金额',
  `refund_fee` decimal(10,2) NOT NULL COMMENT '退款总金额',
  `agent_id` int(11) NOT NULL COMMENT 'agent_id',
  `refund_time` int(11) NOT NULL COMMENT '退款更新时间',
  `refund_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '退款状态1未退款2退款成功3退款失败',
  `refund_pay_id` int(11) NOT NULL COMMENT '退款支付ID',
  `refund_pay_type` tinyint(4) NOT NULL COMMENT '退款支付类型1是微信支付2线下支付3库存支付',
  `auth_time` int(11) NOT NULL COMMENT '审核时间',
  `auth_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '审核状态1未审核2审核通过3审核拒绝',
  `author` varchar(255) NOT NULL COMMENT '审核人',
  `type` tinyint(4) NOT NULL COMMENT '1商品订单2礼包订单',
  `reason` varchar(255) NOT NULL COMMENT '理由',
  `refund_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '退款类型1退款2退货',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=126 DEFAULT CHARSET=utf8;

