/*Table structure for table `agent_order_return_goods` */

DROP TABLE IF EXISTS `agent_order_return_goods`;

CREATE TABLE `agent_order_return_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(255) NOT NULL COMMENT '订单编号',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `agent_id` int(11) NOT NULL COMMENT 'agent_id',
  `remark` varchar(255) NOT NULL COMMENT '退货备注',
  `express_name` varchar(255) NOT NULL COMMENT '快递公司名称',
  `express_number` varchar(255) NOT NULL COMMENT '物流编号',
  `express_code` varchar(255) NOT NULL COMMENT '物流公司代码',
  `auth_time` int(11) NOT NULL COMMENT '审核时间',
  `auth_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '审核状态1未审核2审核通过3审核拒绝',
  `author` varchar(255) NOT NULL COMMENT '审核人',
  `reason` varchar(255) NOT NULL COMMENT '理由',
  `agent_order_refund_id` varchar(255) NOT NULL COMMENT '关联的订单退款表',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1是商品2个礼包',
  `financial_auth` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1未审核2是审核通过',
  `financial_time` int(11) NOT NULL COMMENT '财务审核时间',
  `financial_reason` varchar(255) NOT NULL COMMENT '财务审核备注',
  `financial_author` varchar(255) NOT NULL COMMENT '财务审核人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8;

