/*Table structure for table `agent_order_reward` */

DROP TABLE IF EXISTS `agent_order_reward`;

CREATE TABLE `agent_order_reward` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(255) NOT NULL COMMENT '订单编号',
  `agent_id` int(11) NOT NULL COMMENT '享受奖励的代理商ID',
  `create_time` int(11) NOT NULL DEFAULT '1' COMMENT '创建时间',
  `directsale_reward` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '代理直销奖励',
  `wholesale_reward` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '代理批发收益',
  `recommend_reward` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '推荐奖励',
  `recommend_hierarchy` int(11) NOT NULL COMMENT '推荐奖励层级',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '结算状态1未结算2已结算3失效',
  `update_time` int(11) NOT NULL DEFAULT '1' COMMENT '更新时间',
  `product_id` int(11) NOT NULL COMMENT '产品ID',
  `remark` varchar(255) NOT NULL COMMENT '备注',
  `reward_type` int(11) NOT NULL COMMENT '奖励类型1是推荐奖励2是直销奖励3是代理间接收益4是代理自购奖励5库存充值间接奖励-下级升级6招商奖励-下级升级7招商奖励-下级充值库存8库存充值间接奖励-库存充值',
  `sales_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '销售额',
  `selfsale_reward` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '代理直接奖励',
  `charge_reward` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '库存充值奖励',
  `relation_id` varchar(255) NOT NULL COMMENT '关联ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1715 DEFAULT CHARSET=utf8;

