/*Table structure for table `agent_order_setting` */

DROP TABLE IF EXISTS `agent_order_setting`;

CREATE TABLE `agent_order_setting` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `auto_confirm_time` int(11) NOT NULL DEFAULT '1' COMMENT '自动确认收货时间',
  `consignment_info` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1公司2上级代理3俩个都选',
  `time_span` int(11) NOT NULL DEFAULT '1' COMMENT '时长',
  `return_goods_address` varchar(255) NOT NULL COMMENT '退货地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

