/*Table structure for table `agent_orders` */

DROP TABLE IF EXISTS `agent_orders`;

CREATE TABLE `agent_orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(255) NOT NULL COMMENT '订单编号',
  `pid` int(11) NOT NULL COMMENT '产品ID',
  `pname` varchar(255) NOT NULL COMMENT '产品名称',
  `pprice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品单价',
  `ptotal_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品总价',
  `pnumber` int(11) NOT NULL DEFAULT '1' COMMENT '产品数量',
  `agent_id` int(11) NOT NULL COMMENT '代理商ID',
  `paystyle` tinyint(4) NOT NULL DEFAULT '1' COMMENT '支付方式1是线下支付',
  `isvalid` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1是有效2是失效',
  `create_time` int(11) NOT NULL COMMENT '订单创建时间',
  `order_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `order_amount_pay` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单支付金额',
  `ptotal_price_pay` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品支付总价',
  `trans_expenses` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单运费',
  `order_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '订单状态2待发货3已发货4交易完成 5已关闭 6订单删除7售后服务',
  `remark` varchar(255) NOT NULL COMMENT '订单备注',
  `delivery_time` int(11) NOT NULL COMMENT '订单发货时间',
  `delivery_agent_id` int(11) NOT NULL COMMENT '订单发货代理商其中ID为1是公司发货',
  `commplete_time` int(11) NOT NULL COMMENT '订单完成时间',
  `delivery_id` int(11) NOT NULL COMMENT '发货信息表ID',
  `reward_id` varchar(255) NOT NULL COMMENT '订单奖励表ID',
  `consignee_address_id` int(11) NOT NULL COMMENT '收货人地址表ID',
  `pay_time` int(11) NOT NULL COMMENT '支付时间',
  `pay_id` int(10) NOT NULL COMMENT 'pay_id',
  `refund_time` int(11) NOT NULL COMMENT '退款时间',
  `order_refund_id` int(11) NOT NULL COMMENT '退款信息ID',
  `agent_remark` varchar(255) NOT NULL COMMENT '买家留言',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=964 DEFAULT CHARSET=utf8;

