/*Table structure for table `agent_performance_reward` */

DROP TABLE IF EXISTS `agent_performance_reward`;

CREATE TABLE `agent_performance_reward` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `agent_id` int(11) NOT NULL COMMENT '代理商ID',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `month` int(11) NOT NULL COMMENT '月份',
  `year` int(11) NOT NULL COMMENT '年份',
  `performance_profit` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本月业绩分红',
  `increate_ratio` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本月增长比例/系数',
  `last_performance_base` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '上月业绩分红基数',
  `current_performance_base` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本月业绩分红基数',
