  `status` tinyint(4) NOT NULL COMMENT '结算类型1未结算2已结算3失效',
  `remark` varchar(255) NOT NULL COMMENT '备注',
  `current_recommend_profit` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本月招商奖励',
  `current_promotion_gift_profit` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本月其他奖励（礼包+库存）',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=109 DEFAULT CHARSET=utf8;

