/*Table structure for table `agent_reward_agency` */

DROP TABLE IF EXISTS `agent_reward_agency`;

CREATE TABLE `agent_reward_agency` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `role` int(11) NOT NULL DEFAULT '0' COMMENT '代理商等级角色',
  `ratio` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '奖励比例%',
  `pre_deposit` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '预存款额度',
  `first_goods_number` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '首次拿货数量%',
  `first_goods_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '首次拿货金额',
  `lowest_limit` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '最低库存额度',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8;

