/*Table structure for table `agent_reward_config` */

DROP TABLE IF EXISTS `agent_reward_config`;

CREATE TABLE `agent_reward_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recommend_reward_name` varchar(255) NOT NULL DEFAULT '推荐奖励' COMMENT '推荐奖励名称',
  `valid_recommend_reward` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否开启推荐奖励',
  `agency_reward_name` varchar(255) NOT NULL DEFAULT '代理奖励' COMMENT '代理奖励名称',
  `valid_agency_reward` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否开启代理奖励',
  `performance_reward_name` varchar(255) NOT NULL DEFAULT '业绩奖励' COMMENT '业绩奖励名称',
  `valid_performance_reward` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否开启业绩奖励',
  `performance_reward_clear_date` int(11) NOT NULL DEFAULT '1' COMMENT '绩效奖励结算日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

