insert  into `agent_reward_config`(`id`,`recommend_reward_name`,`valid_recommend_reward`,`agency_reward_name`,`valid_agency_reward`,`performance_reward_name`,`valid_performance_reward`,`performance_reward_clear_date`) values (32,'推荐奖励',1,'代理奖励',1,'业绩奖励',1,2);

