/*Table structure for table `agent_stock_change` */

DROP TABLE IF EXISTS `agent_stock_change`;

CREATE TABLE `agent_stock_change` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `agent_id` int(11) NOT NULL COMMENT '代理商ID',
  `create_time` int(11) NOT NULL COMMENT '申请时间',
  `change_before` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '变动前金额',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '变动金额',
  `status` tinyint(4) NOT NULL COMMENT '审核状态1待审核2已审核3驳回',
  `account_type` tinyint(4) NOT NULL COMMENT '账号类型1微信2支付宝3银行卡4系统后台充值5其他',
  `change_type` tinyint(4) NOT NULL COMMENT '变动类型1申请充值2后台充值3减库存4加库存5下级升级减库存6用户升级充值库存7库存充值减库存8购买商品增加库存9下级转账减库存10上级转账加库存',
  `order_number` varchar(255) NOT NULL COMMENT '订单号',
  `remark` varchar(255) NOT NULL COMMENT '备注',
  `audit_time` int(11) NOT NULL COMMENT '审核时间',
  `auditor_id` int(11) NOT NULL COMMENT '审核人',
  `change_after` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '变动后金额',
  `product_id` int(11) NOT NULL COMMENT '对应的产品ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1435 DEFAULT CHARSET=utf8;

