/*Table structure for table `agent_stock_charge` */

DROP TABLE IF EXISTS `agent_stock_charge`;

CREATE TABLE `agent_stock_charge` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `agent_id` int(11) NOT NULL COMMENT '代理商ID',
  `create_time` int(11) NOT NULL COMMENT '申请时间',
  `recharge_before` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '充值前金额',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '充值金额',
  `status` tinyint(4) NOT NULL COMMENT '审核状态1待审核2已审核3驳回',
  `account_type` tinyint(4) NOT NULL COMMENT '充值账号类型1微信2支付宝3银行卡4系统后台充值5其他',
  `charge_type` tinyint(4) NOT NULL COMMENT '充值类型1申请充值2后台充值',
  `remark` varchar(255) NOT NULL COMMENT '备注',
  `audit_time` int(11) NOT NULL COMMENT '审核时间',
  `auditor_id` int(11) NOT NULL COMMENT '审核人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `agent_stock_charge` */

/*Table structure for table `agent_stock_charge_order` */

DROP TABLE IF EXISTS `agent_stock_charge_order`;

CREATE TABLE `agent_stock_charge_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(255) NOT NULL COMMENT '商户订单号',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `order_amount_pay` decimal(10,2) NOT NULL COMMENT '订单总金额',
  `agent_id` int(11) NOT NULL COMMENT 'agent_id',
  `type` tinyint(4) NOT NULL COMMENT '充值类型1微信支付',
  `pay_time` int(11) NOT NULL COMMENT '支付时间',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '支付状态1未支付2支付完成3支付失败',
  `pay_id` int(11) NOT NULL COMMENT '支付表ID',
  `operator_agent_id` int(11) NOT NULL COMMENT '操作人ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=96 DEFAULT CHARSET=utf8;

