/*Table structure for table `agent_stock_transfer` */

DROP TABLE IF EXISTS `agent_stock_transfer`;

CREATE TABLE `agent_stock_transfer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `operater_agent_id` int(11) NOT NULL COMMENT '转账人操作人ID',
  `agent_id` int(11) NOT NULL COMMENT '转账目标人ID',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '转账额度',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1是成功2是失败',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8;

