/*Table structure for table `agents` */

DROP TABLE IF EXISTS `agents`;

CREATE TABLE `agents` (
  `agent_id` int(11) NOT NULL AUTO_INCREMENT,
  `nickname` varchar(255) DEFAULT NULL COMMENT '名称',
  `wechat` varchar(255) DEFAULT NULL COMMENT '微信号',
  `password` varchar(255) NOT NULL COMMENT '密码',
  `phone` varchar(255) NOT NULL COMMENT '登录账号/手机号',
  `create_ctime` datetime NOT NULL COMMENT '注册时间',
  `end_etime` varchar(30) DEFAULT '-1' COMMENT '截止日期,-1为永久',
  `generation` int(11) NOT NULL DEFAULT '1' COMMENT '代数',
  `role` int(11) DEFAULT '0' COMMENT '角色:0会员1铜2银3金4钻石5皇冠6分公司',
  `inviter` varchar(255) DEFAULT NULL COMMENT '邀请人',
  `family` varchar(255) DEFAULT NULL COMMENT '上级族谱',
  `name` varchar(255) DEFAULT NULL COMMENT '姓名',
  `sex` enum('m','w') NOT NULL DEFAULT 'm' COMMENT '性别:m男w女s保密',
  `id_card` varchar(255) DEFAULT NULL COMMENT '身份证号',
  `province` int(11) DEFAULT NULL COMMENT '省',
  `city` int(11) DEFAULT NULL COMMENT '市',
  `area` int(11) DEFAULT NULL COMMENT '区/县',
  `address` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `is_del` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否删除:0否1是',
  `is_use` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否启用:0否1是',
  `stock_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '库存金额',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '代理商状态:0默认1申请注册2申请升级3已确认4驳回5取消',
  `qq` varchar(255) NOT NULL COMMENT 'qq号',
  `head_img` varchar(255) NOT NULL DEFAULT '/static/Images/default_head.png' COMMENT '头像图片',
  `qr_code_img` varchar(255) NOT NULL COMMENT '二维码图片',
  `profit` decimal(10,2) DEFAULT '0.00' COMMENT '收益总额',
  PRIMARY KEY (`agent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=100133 DEFAULT CHARSET=utf8;

