/*Table structure for table `agents_data_count_for_rank` */

DROP TABLE IF EXISTS `agents_data_count_for_rank`;

CREATE TABLE `agents_data_count_for_rank` (
  `a_id` int(11) NOT NULL,
  `sales_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '销售总额',
  `rewards_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '奖励总额',
  `recommend_num` int(11) NOT NULL DEFAULT '0' COMMENT '推荐人数',
  `team_num` int(11) NOT NULL DEFAULT '0' COMMENT '直属团队',
  `team_rank` int(11) NOT NULL COMMENT '团队排名',
  `recommend_rank` int(11) NOT NULL COMMENT '推荐排名',
  `reward_rank` int(11) NOT NULL COMMENT '奖励排名',
  `sale_rank` int(11) NOT NULL COMMENT '销量排名',
  `is_del` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除: 0否 1是',
