/*Table structure for table `express_company` */

DROP TABLE IF EXISTS `express_company`;

CREATE TABLE `express_company` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '物流公司名称',
  `code` varchar(255) NOT NULL COMMENT '对应的查询代码',
  `create_ctime` datetime NOT NULL COMMENT '创建时间',
  `is_del` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除',
  `is_use` int(11) NOT NULL DEFAULT '1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

