/*Table structure for table `express_rule` */

DROP TABLE IF EXISTS `express_rule`;

CREATE TABLE `express_rule` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '名称',
  `type` int(11) NOT NULL DEFAULT '1' COMMENT '计价类型:1按件2按重',
  `first_num` decimal(10,2) NOT NULL DEFAULT '1.00' COMMENT '首件件数/首重重量',
  `first_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '首件/首重费用',
  `continue_num` decimal(10,2) NOT NULL DEFAULT '1.00' COMMENT '续件件数/续重重量',
  `continue_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '续件/续重费用',
  `free_num` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '按件免邮/按重免邮',
  `is_inside` int(11) NOT NULL DEFAULT '1' COMMENT '区域模式:1域内0域外',
  `cost` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '此规则所需满足金额:0无限制',
  `province` text NOT NULL COMMENT '选择的省级区域',
  `city` text NOT NULL COMMENT '选择的市级区域',
  `area` text NOT NULL COMMENT '选择的县级区域',
  `create_ctime` datetime NOT NULL COMMENT '创建时间',
  `is_valid` int(11) NOT NULL DEFAULT '1' COMMENT '是否有效:1有效0无效',
  `is_del` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除:1是0否',
  PRIMARY KEY (`id`)
