/*Table structure for table `product_management` */

DROP TABLE IF EXISTS `product_management`;

CREATE TABLE `product_management` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_name` varchar(255) NOT NULL COMMENT '产品名称',
  `category_id` int(11) NOT NULL COMMENT '类目管理ID',
  `classify_id` int(11) NOT NULL COMMENT '分类管理ID',
  `product_img` varchar(255) NOT NULL DEFAULT '/static/Images/default_product.jpg' COMMENT '封面图片',
  `explain` varchar(255) NOT NULL COMMENT '封面图片简短说明',
  `sales_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '销售价格',
  `cost_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '成本价格',
  `unit` varchar(255) NOT NULL COMMENT '单位',
  `weight` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '重量',
  `inventory` int(11) NOT NULL COMMENT '库存',
  `sales_volume` int(11) DEFAULT '0' COMMENT '产品销量',
  `details` varchar(255) NOT NULL COMMENT '详情说明',
  `specification` varchar(255) NOT NULL COMMENT '产品规格',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1上架,0下架',
  `exemption_from_postage` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1包邮,0不包邮',
  `create_time` int(11) NOT NULL COMMENT '产品添加时间',
  `is_gift` tinyint(4) NOT NULL DEFAULT '2' COMMENT '是否礼包产品1是其他否',
  `is_first_order` tinyint(4) NOT NULL DEFAULT '2' COMMENT '是否首单产品1是其他否',
  `end_time` int(11) NOT NULL COMMENT '下架时间',
  `putaway_time` int(11) NOT NULL COMMENT '上架时间',
  `false_volume` int(11) NOT NULL COMMENT '产品售出设置',
  `express` int(11) NOT NULL COMMENT '运费模板',
  `is_Purchase_a` tinyint(4) NOT NULL DEFAULT '2' COMMENT '限购一件1为是   2为否',
  `is_agent_level` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0是普通 其他为等级ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8;

