/*Table structure for table `profit_to_stock_log` */

DROP TABLE IF EXISTS `profit_to_stock_log`;

CREATE TABLE `profit_to_stock_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `a_id` int(11) NOT NULL COMMENT '代理商ID',
  `money` decimal(10,2) NOT NULL COMMENT '转存金额',
  `create_time` int(11) NOT NULL COMMENT '提交时间',
  `is_del` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除',
  `profit` decimal(10,2) DEFAULT NULL COMMENT '转前当时的收益',
  `stock` decimal(10,2) DEFAULT NULL COMMENT '转后当时的库存',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

