  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '下单日期',
  `delivery_time` int(11) NOT NULL DEFAULT '0' COMMENT '发货日期',
  `confirm_time` int(11) NOT NULL DEFAULT '0' COMMENT '收货日期',
  `complete_time` int(11) NOT NULL DEFAULT '0' COMMENT '完成日期',
  `gift_id` int(11) NOT NULL DEFAULT '0' COMMENT '礼包ID',
  `agent_id` int(11) NOT NULL DEFAULT '0' COMMENT '代理ID',
  `consignee_name` varchar(255) NOT NULL COMMENT '收货人姓名',
  `consignee_phone` varchar(255) NOT NULL COMMENT '收货人手机',
