/*Table structure for table `weixin_pay` */

DROP TABLE IF EXISTS `weixin_pay`;

CREATE TABLE `weixin_pay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `out_trade_no` varchar(255) NOT NULL COMMENT '商户订单号',
  `sign` varchar(255) NOT NULL COMMENT '签名',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `body` varchar(255) NOT NULL COMMENT '商品描述',
  `total_fee` int(11) NOT NULL COMMENT '订单总金额，单位为分',
  `notify_url` varchar(1000) NOT NULL COMMENT '通知地址',
  `trade_type` varchar(255) NOT NULL COMMENT '交易类型',
  `openid` varchar(255) NOT NULL COMMENT '用户标识',
  `userid` int(11) NOT NULL COMMENT 'userid',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  `status` tinyint(4) NOT NULL COMMENT '支付状态1未支付2支付成功',
  `transaction_id` varchar(255) NOT NULL COMMENT '微信支付订单号',
  `pay_type` tinyint(4) NOT NULL COMMENT '支付场景1商品支付2大礼包支付3库存充值',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=286 DEFAULT CHARSET=utf8;

