/*Table structure for table `weixin_pay_refund` */

DROP TABLE IF EXISTS `weixin_pay_refund`;

CREATE TABLE `weixin_pay_refund` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `out_trade_no` varchar(255) NOT NULL COMMENT '商户订单号',
  `sign` varchar(255) NOT NULL COMMENT '签名',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `out_refund_no` varchar(255) NOT NULL COMMENT '商户退款单号',
  `total_fee` int(11) NOT NULL COMMENT '订单总金额，单位为分',
  `refund_fee` int(11) NOT NULL COMMENT '退款金额，单位为分',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  `status` tinyint(4) NOT NULL COMMENT '退款状态1未退款2退款成功3退款失败',
  `return_code` varchar(255) NOT NULL COMMENT '返回状态码',
  `return_msg` varchar(255) NOT NULL COMMENT '返回信息',
  `refund_id` varchar(255) NOT NULL COMMENT '微信退款单号',
  `transaction_id` varchar(255) NOT NULL COMMENT '微信订单号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8;

