/*Table structure for table `weixin_users` */

DROP TABLE IF EXISTS `weixin_users`;

CREATE TABLE `weixin_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `openid` varchar(255) NOT NULL COMMENT 'openid',
  `agent_id` int(11) NOT NULL COMMENT '代理商表的ID',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `nickname` varchar(255) NOT NULL COMMENT '昵称',
  `headimgurl` varchar(255) NOT NULL COMMENT '头像',
  `city` varchar(255) NOT NULL COMMENT '城市',
  `province` varchar(255) NOT NULL COMMENT '省份',
  `country` varchar(255) NOT NULL COMMENT '国家',
  `sex` tinyint(4) NOT NULL COMMENT '1男性2女性0未知',
  `scope` varchar(255) NOT NULL COMMENT 'scope',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=353 DEFAULT CHARSET=utf8;

