/*Table structure for table `withdrawals_log` */

DROP TABLE IF EXISTS `withdrawals_log`;

CREATE TABLE `withdrawals_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `a_id` int(11) NOT NULL COMMENT '代理商ID',
  `audit` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1待审,2已审,3驳回',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提现额',
  `type` tinyint(4) NOT NULL COMMENT '账户类型1支付宝,2银行卡',
  `create_ctime` datetime NOT NULL COMMENT '申请日期',
  `audit_atime` datetime NOT NULL COMMENT '审核日期',
  `remark` varchar(255) NOT NULL COMMENT '备注',
  `result` varchar(255) NOT NULL COMMENT '结果',
  `auditer` varchar(255) NOT NULL COMMENT '审核人',
  `account_bank` varchar(255) NOT NULL COMMENT '开户行',
  `account_name` varchar(255) NOT NULL COMMENT '姓名',
  `account` varchar(255) NOT NULL COMMENT '账号',
  `change_before` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '变动前金额',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

